import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import { Nav, Navbar, NavItem } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';

import LandingApp from './apps/landingApp';
import ProjectsApp from './apps/projectsApp';
import AboutApp from './apps/aboutApp';

import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

export default class App extends Component {
  render() {
    return (
      <Router>
        <div className='App'>
          <Navbar style={{backgroundColor: '#222'}} >
            <Navbar.Header>
              <Navbar.Brand>
                <Link to='/home'>
                  <img src={logo} className='logo' alt='logo'/>
                  <h3 className='title'>Design Department</h3>
                </Link>
              </Navbar.Brand>
            <Navbar.Toggle />
            </Navbar.Header>
            <Navbar.Collapse>
              <Nav bsStyle="pills">
                <LinkContainer to='/home'>
                  <NavItem eventKey={1}>Home</NavItem>
                </LinkContainer>
                <LinkContainer to='/projects'>
                  <NavItem eventKey={2}>Projects</NavItem>
                </LinkContainer>
                <LinkContainer to='/about'>
                  <NavItem eventKey={3}>About</NavItem>
                </LinkContainer>
              </Nav>
            </Navbar.Collapse>
          </Navbar>
          <Route exact path='/' component={LandingApp} />
          <Route path='/home' component={LandingApp} />
          <Route path='/projects' component={ProjectsApp} />
          <Route path='/about' component={AboutApp} />
        </div>
      </Router>
    );
  }
}
